import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';

// –í—Ä–µ–º–µ–Ω–Ω—ã–µ –∑–∞–≥–ª—É—à–∫–∏
const PriceListTemp = () => (
  <div style={{ padding: '50px', color: 'white', background: '#000', minHeight: '100vh' }}>
    <h1 style={{ color: 'red' }}>üìã –ü—Ä–∞–π—Å-–ª–∏—Å—Ç</h1>
    <p>–°–∫–æ—Ä–æ –∑–¥–µ—Å—å –ø–æ—è–≤–∏—Ç—Å—è —Ç–≤–æ–π –ø—Ä–∞–π—Å-–ª–∏—Å—Ç!</p>
  </div>
);

const GameTemp = () => (
  <div style={{ padding: '50px', color: 'white', background: '#000', minHeight: '100vh' }}>
    <h1 style={{ color: 'red' }}>üéÆ –ò–≥—Ä–∞ "–ù–∞–π–¥–∏ –æ—à–∏–±–∫—É"</h1>
    <p>–ò–≥—Ä–∞ –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è —Å–∫–∏–¥–∫–∏ 10%!</p>
  </div>
);

const ContactsTemp = () => (
  <div style={{ padding: '50px', color: 'white', background: '#000', minHeight: '100vh' }}>
    <h1 style={{ color: 'red' }}>üìû –ö–æ–Ω—Ç–∞–∫—Ç—ã</h1>
    <p>Telegram: @Lyokorps</p>
  </div>
);

function App() {
  return (
    <Router>
      <div style={{
        minHeight: '100vh',
        background: '#000000',
        fontFamily: 'Arial, sans-serif'
      }}>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/pricelist" element={<PriceListTemp />} />
          <Route path="/game" element={<GameTemp />} />
          <Route path="/contacts" element={<ContactsTemp />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
